import BABYLON from "./babylon";

export function materialToonGrass() {
  var nodeMaterial = new BABYLON.NodeMaterial("node");

  // InputBlock
  var position = new BABYLON.InputBlock("position");
  position.visibleInInspector = false;
  position.visibleOnFrame = false;
  position.target = 1;
  position.setAsAttribute("position");

  // TransformBlock
  var worldPos = new BABYLON.TransformBlock("worldPos");
  worldPos.visibleInInspector = false;
  worldPos.visibleOnFrame = false;
  worldPos.target = 1;
  worldPos.complementZ = 0;
  worldPos.complementW = 1;

  // InputBlock
  var world = new BABYLON.InputBlock("world");
  world.visibleInInspector = false;
  world.visibleOnFrame = false;
  world.target = 1;
  world.setAsSystemValue(BABYLON.NodeMaterialSystemValues.World);

  // TransformBlock
  var Worldnormal = new BABYLON.TransformBlock("World normal");
  Worldnormal.visibleInInspector = false;
  Worldnormal.visibleOnFrame = false;
  Worldnormal.target = 1;
  Worldnormal.complementZ = 0;
  Worldnormal.complementW = 0;

  // InputBlock
  var normal = new BABYLON.InputBlock("normal");
  normal.visibleInInspector = false;
  normal.visibleOnFrame = false;
  normal.target = 1;
  normal.setAsAttribute("normal");

  // VectorSplitterBlock
  var N = new BABYLON.VectorSplitterBlock("N");
  N.visibleInInspector = false;
  N.visibleOnFrame = false;
  N.target = 4;

  // NormalizeBlock
  var NNormalized = new BABYLON.NormalizeBlock("N (Normalized)");
  NNormalized.visibleInInspector = false;
  NNormalized.visibleOnFrame = false;
  NNormalized.target = 4;

  // DotBlock
  var NDotLDiffuseLightIntensity = new BABYLON.DotBlock(
    "N Dot L (Diffuse Light Intensity)"
  );
  NDotLDiffuseLightIntensity.visibleInInspector = false;
  NDotLDiffuseLightIntensity.visibleOnFrame = false;
  NDotLDiffuseLightIntensity.target = 4;

  // NormalizeBlock
  var LNormalized = new BABYLON.NormalizeBlock("L (Normalized)");
  LNormalized.visibleInInspector = false;
  LNormalized.visibleOnFrame = false;
  LNormalized.target = 4;

  // LightInformationBlock
  var Lightinformation = new BABYLON.LightInformationBlock("Light information");
  Lightinformation.visibleInInspector = false;
  Lightinformation.visibleOnFrame = false;
  Lightinformation.target = 1;

  // StepBlock
  var QuantizedDiffuseLightIntensity = new BABYLON.StepBlock(
    "Quantized Diffuse Light Intensity"
  );
  QuantizedDiffuseLightIntensity.visibleInInspector = false;
  QuantizedDiffuseLightIntensity.visibleOnFrame = false;
  QuantizedDiffuseLightIntensity.target = 4;

  // InputBlock
  var DiffuseCutoff = new BABYLON.InputBlock("Diffuse Cutoff");
  DiffuseCutoff.visibleInInspector = false;
  DiffuseCutoff.visibleOnFrame = false;
  DiffuseCutoff.target = 1;
  DiffuseCutoff.value = 0;
  DiffuseCutoff.min = 0;
  DiffuseCutoff.max = 0;
  DiffuseCutoff.isBoolean = false;
  DiffuseCutoff.matrixMode = 0;
  DiffuseCutoff.animationType = BABYLON.AnimatedInputBlockTypes.None;
  DiffuseCutoff.isConstant = false;

  // ScaleBlock
  var DiffuseLightCalculation = new BABYLON.ScaleBlock(
    "Diffuse Light Calculation"
  );
  DiffuseLightCalculation.visibleInInspector = false;
  DiffuseLightCalculation.visibleOnFrame = false;
  DiffuseLightCalculation.target = 4;

  // InputBlock
  var DiffuseLightColor = new BABYLON.InputBlock("Diffuse Light Color");
  DiffuseLightColor.visibleInInspector = false;
  DiffuseLightColor.visibleOnFrame = false;
  DiffuseLightColor.target = 1;
  DiffuseLightColor.value = new BABYLON.Color3(
    0.6901960784313725,
    0.6901960784313725,
    0.6901960784313725
  );
  DiffuseLightColor.isConstant = false;

  // AddBlock
  var AddAmbienttoDiffuseLight = new BABYLON.AddBlock(
    "Add Ambient to Diffuse Light"
  );
  AddAmbienttoDiffuseLight.visibleInInspector = false;
  AddAmbienttoDiffuseLight.visibleOnFrame = false;
  AddAmbienttoDiffuseLight.target = 4;

  // InputBlock
  var AmbientLightColor = new BABYLON.InputBlock("Ambient Light Color");
  AmbientLightColor.visibleInInspector = false;
  AmbientLightColor.visibleOnFrame = false;
  AmbientLightColor.target = 1;
  AmbientLightColor.value = new BABYLON.Color3(
    0.1803921568627451,
    0.1803921568627451,
    0.1803921568627451
  );
  AmbientLightColor.isConstant = false;

  // MultiplyBlock
  var MultiplyLightingbyColor = new BABYLON.MultiplyBlock(
    "Multiply Lighting by Color"
  );
  MultiplyLightingbyColor.visibleInInspector = false;
  MultiplyLightingbyColor.visibleOnFrame = false;
  MultiplyLightingbyColor.target = 4;

  // InputBlock
  var SurfaceColor = new BABYLON.InputBlock("Surface Color");
  SurfaceColor.visibleInInspector = false;
  SurfaceColor.visibleOnFrame = false;
  SurfaceColor.target = 1;
  SurfaceColor.value = new BABYLON.Color3(
    0.4,
    0.5764705882352941,
    0.3568627450980392
  );
  SurfaceColor.isConstant = false;

  // FragmentOutputBlock
  var fragmentOutput = new BABYLON.FragmentOutputBlock("fragmentOutput");
  fragmentOutput.visibleInInspector = false;
  fragmentOutput.visibleOnFrame = false;
  fragmentOutput.target = 2;
  fragmentOutput.convertToGammaSpace = undefined;
  fragmentOutput.convertToLinearSpace = undefined;
  fragmentOutput.useLogarithmicDepth = false;

  // TransformBlock
  var worldPosviewProjectionTransform = new BABYLON.TransformBlock(
    "worldPos * viewProjectionTransform"
  );
  worldPosviewProjectionTransform.visibleInInspector = false;
  worldPosviewProjectionTransform.visibleOnFrame = false;
  worldPosviewProjectionTransform.target = 1;
  worldPosviewProjectionTransform.complementZ = 0;
  worldPosviewProjectionTransform.complementW = 1;

  // InputBlock
  var viewProjection = new BABYLON.InputBlock("viewProjection");
  viewProjection.visibleInInspector = false;
  viewProjection.visibleOnFrame = false;
  viewProjection.target = 1;
  viewProjection.setAsSystemValue(
    BABYLON.NodeMaterialSystemValues.ViewProjection
  );

  // VertexOutputBlock
  var vertexOutput = new BABYLON.VertexOutputBlock("vertexOutput");
  vertexOutput.visibleInInspector = false;
  vertexOutput.visibleOnFrame = false;
  vertexOutput.target = 1;

  // Connections
  position.output.connectTo(worldPos.vector);
  world.output.connectTo(worldPos.transform);
  worldPos.output.connectTo(worldPosviewProjectionTransform.vector);
  viewProjection.output.connectTo(worldPosviewProjectionTransform.transform);
  worldPosviewProjectionTransform.output.connectTo(vertexOutput.vector);
  AmbientLightColor.output.connectTo(AddAmbienttoDiffuseLight.left);
  DiffuseLightColor.output.connectTo(DiffuseLightCalculation.input);
  normal.output.connectTo(Worldnormal.vector);
  world.output.connectTo(Worldnormal.transform);
  Worldnormal.output.connectTo(N.xyzw);
  N.xyzOut.connectTo(NNormalized.input);
  NNormalized.output.connectTo(NDotLDiffuseLightIntensity.left);
  worldPos.output.connectTo(Lightinformation.worldPosition);
  Lightinformation.direction.connectTo(LNormalized.input);
  LNormalized.output.connectTo(NDotLDiffuseLightIntensity.right);
  NDotLDiffuseLightIntensity.output.connectTo(
    QuantizedDiffuseLightIntensity.value
  );
  DiffuseCutoff.output.connectTo(QuantizedDiffuseLightIntensity.edge);
  QuantizedDiffuseLightIntensity.output.connectTo(
    DiffuseLightCalculation.factor
  );
  DiffuseLightCalculation.output.connectTo(AddAmbienttoDiffuseLight.right);
  AddAmbienttoDiffuseLight.output.connectTo(MultiplyLightingbyColor.left);
  SurfaceColor.output.connectTo(MultiplyLightingbyColor.right);
  MultiplyLightingbyColor.output.connectTo(fragmentOutput.rgb);

  // Output nodes
  nodeMaterial.addOutputNode(vertexOutput);
  nodeMaterial.addOutputNode(fragmentOutput);
  nodeMaterial.build();

  return nodeMaterial;
}

export function dumbGrass() {
  var nodeMaterial = new BABYLON.NodeMaterial("node");

  // InputBlock
  var position = new BABYLON.InputBlock("position");
  position.visibleInInspector = false;
  position.visibleOnFrame = false;
  position.target = 1;
  position.setAsAttribute("position");

  // TransformBlock
  var worldPos = new BABYLON.TransformBlock("worldPos");
  worldPos.visibleInInspector = false;
  worldPos.visibleOnFrame = false;
  worldPos.target = 1;
  worldPos.complementZ = 0;
  worldPos.complementW = 1;

  // InputBlock
  var world = new BABYLON.InputBlock("world");
  world.visibleInInspector = false;
  world.visibleOnFrame = false;
  world.target = 1;
  world.setAsSystemValue(BABYLON.NodeMaterialSystemValues.World);

  // TransformBlock
  var worldnormal = new BABYLON.TransformBlock("world normal");
  worldnormal.visibleInInspector = false;
  worldnormal.visibleOnFrame = false;
  worldnormal.target = 1;
  worldnormal.complementZ = 0;
  worldnormal.complementW = 0;

  // InputBlock
  var normal = new BABYLON.InputBlock("normal");
  normal.visibleInInspector = false;
  normal.visibleOnFrame = false;
  normal.target = 1;
  normal.setAsAttribute("normal");

  // LightBlock
  var Lights = new BABYLON.LightBlock("Lights");
  Lights.visibleInInspector = false;
  Lights.visibleOnFrame = false;
  Lights.target = 3;

  // InputBlock
  var cameraPosition = new BABYLON.InputBlock("cameraPosition");
  cameraPosition.visibleInInspector = false;
  cameraPosition.visibleOnFrame = false;
  cameraPosition.target = 1;
  cameraPosition.setAsSystemValue(
    BABYLON.NodeMaterialSystemValues.CameraPosition
  );

  // MultiplyBlock
  var Multiply = new BABYLON.MultiplyBlock("Multiply");
  Multiply.visibleInInspector = false;
  Multiply.visibleOnFrame = false;
  Multiply.target = 4;

  // TextureBlock
  var Texture = new BABYLON.TextureBlock("Texture");
  Texture.visibleInInspector = false;
  Texture.visibleOnFrame = false;
  Texture.target = 3;
  Texture.convertToGammaSpace = undefined;
  Texture.convertToLinearSpace = false;
  Texture.disableLevelMultiplication = false;
  Texture.texture = new BABYLON.Texture(
    "data:octet/stream;base64,",
    null,
    false,
    false,
    3
  );
  Texture.texture.wrapU = 1;
  Texture.texture.wrapV = 1;
  Texture.texture.uAng = 0;
  Texture.texture.vAng = 0;
  Texture.texture.wAng = 0;
  Texture.texture.uOffset = 0;
  Texture.texture.vOffset = 0;
  Texture.texture.uScale = 1;
  Texture.texture.vScale = 1;
  Texture.texture.coordinatesMode = 0;

  // InputBlock
  var uv = new BABYLON.InputBlock("uv");
  uv.visibleInInspector = false;
  uv.visibleOnFrame = false;
  uv.target = 1;
  uv.setAsAttribute("uv");

  // TextureBlock
  var Texture1 = new BABYLON.TextureBlock("Texture");
  Texture1.visibleInInspector = false;
  Texture1.visibleOnFrame = false;
  Texture1.target = 3;
  Texture1.convertToGammaSpace = undefined;
  Texture1.convertToLinearSpace = false;
  Texture1.disableLevelMultiplication = false;
  Texture1.texture = new BABYLON.Texture(
    "data:octet/stream;base64,",
    null,
    false,
    false,
    3
  );
  Texture1.texture.wrapU = 1;
  Texture1.texture.wrapV = 1;
  Texture1.texture.uAng = 0;
  Texture1.texture.vAng = 0;
  Texture1.texture.wAng = 0;
  Texture1.texture.uOffset = 0;
  Texture1.texture.vOffset = 0;
  Texture1.texture.uScale = 1;
  Texture1.texture.vScale = 1;
  Texture1.texture.coordinatesMode = 0;

  // AddBlock
  var Add = new BABYLON.AddBlock("Add");
  Add.visibleInInspector = false;
  Add.visibleOnFrame = false;
  Add.target = 4;

  // FragmentOutputBlock
  var fragmentOutput = new BABYLON.FragmentOutputBlock("fragmentOutput");
  fragmentOutput.visibleInInspector = false;
  fragmentOutput.visibleOnFrame = false;
  fragmentOutput.target = 2;
  fragmentOutput.convertToGammaSpace = undefined;
  fragmentOutput.convertToLinearSpace = undefined;
  fragmentOutput.useLogarithmicDepth = false;

  // TextureBlock
  var Texture2 = new BABYLON.TextureBlock("Texture");
  Texture2.visibleInInspector = false;
  Texture2.visibleOnFrame = false;
  Texture2.target = 3;
  Texture2.convertToGammaSpace = undefined;
  Texture2.convertToLinearSpace = false;
  Texture2.disableLevelMultiplication = false;
  Texture2.texture = new BABYLON.Texture(
    "data:octet/stream;base64,",
    null,
    false,
    false,
    3
  );
  Texture2.texture.wrapU = 1;
  Texture2.texture.wrapV = 1;
  Texture2.texture.uAng = 0;
  Texture2.texture.vAng = 0;
  Texture2.texture.wAng = 0;
  Texture2.texture.uOffset = 0;
  Texture2.texture.vOffset = 0;
  Texture2.texture.uScale = 1;
  Texture2.texture.vScale = 1;
  Texture2.texture.coordinatesMode = 0;

  // TransformBlock
  var worldPosviewProjectionTransform = new BABYLON.TransformBlock(
    "worldPos * viewProjectionTransform"
  );
  worldPosviewProjectionTransform.visibleInInspector = false;
  worldPosviewProjectionTransform.visibleOnFrame = false;
  worldPosviewProjectionTransform.target = 1;
  worldPosviewProjectionTransform.complementZ = 0;
  worldPosviewProjectionTransform.complementW = 1;

  // InputBlock
  var viewProjection = new BABYLON.InputBlock("viewProjection");
  viewProjection.visibleInInspector = false;
  viewProjection.visibleOnFrame = false;
  viewProjection.target = 1;
  viewProjection.setAsSystemValue(
    BABYLON.NodeMaterialSystemValues.ViewProjection
  );

  // VertexOutputBlock
  var vertexOutput = new BABYLON.VertexOutputBlock("vertexOutput");
  vertexOutput.visibleInInspector = false;
  vertexOutput.visibleOnFrame = false;
  vertexOutput.target = 1;

  // Connections
  position.output.connectTo(worldPos.vector);
  world.output.connectTo(worldPos.transform);
  worldPos.output.connectTo(worldPosviewProjectionTransform.vector);
  viewProjection.output.connectTo(worldPosviewProjectionTransform.transform);
  worldPosviewProjectionTransform.output.connectTo(vertexOutput.vector);
  worldPos.output.connectTo(Lights.worldPosition);
  normal.output.connectTo(worldnormal.vector);
  world.output.connectTo(worldnormal.transform);
  worldnormal.output.connectTo(Lights.worldNormal);
  cameraPosition.output.connectTo(Lights.cameraPosition);
  Lights.diffuseOutput.connectTo(Multiply.left);
  uv.output.connectTo(Texture.uv);
  Texture.rgb.connectTo(Multiply.right);
  Multiply.output.connectTo(Add.left);
  uv.output.connectTo(Texture1.uv);
  Texture1.rgb.connectTo(Add.right);
  Add.output.connectTo(fragmentOutput.rgb);
  uv.output.connectTo(Texture2.uv);
  Texture2.a.connectTo(fragmentOutput.a);

  // Output nodes
  nodeMaterial.addOutputNode(vertexOutput);
  nodeMaterial.addOutputNode(fragmentOutput);
  nodeMaterial.build();

  return nodeMaterial;
}
